import { UpdatePost } from '~post/controllers/update-post';
import { Request, Response } from 'express';
import HTTP_STATUS from 'http-status-codes';
import { PostCache } from '~services/redis/post.cache';
import { postQueue } from '~services/queues/post.queue';
import { postMockRequest, newPost, postMockResponse, postMockData, updatedPost, updatedPostWithImage } from '~mocks/post.mock';
import * as postServer from '~sockets/post.socket';
import { Server } from 'socket.io';
import { authUserPayload } from '~mocks/auth.mock';
import * as cloudinaryUploads from '~global/helpers/cloudinary-upload';
import { UploadApiResponse } from 'cloudinary';
import { CustomError } from '~global/helpers/error-handler';

Object.defineProperties(postServer, {
  socketIOPostObject: {
    value: new Server(),
    writable: true
  }
});

jest.useFakeTimers();
jest.mock('~services/redis/post.cache');
jest.mock('~services/queues/base.queue');
jest.mock('~services/queues/post.queue');
jest.mock('~global/helpers/cloudinary-upload');

describe('UpdatePost', () => {
  beforeEach(() => {
    jest.resetAllMocks();
  });
  afterEach(() => {
    jest.clearAllMocks();
    jest.clearAllTimers();
  });

  it('Should send correct json', async () => {
    delete newPost.image;
    const req: Request = postMockRequest(updatedPost, authUserPayload, { postId: postMockData._id?.toString() }) as Request;
    const res: Response = postMockResponse();

    jest.spyOn(postQueue, 'addPostJob');
    jest.spyOn(PostCache.prototype, 'updatePostInCache').mockResolvedValue(postMockData);
    jest.spyOn(postServer.socketIOPostObject, 'emit');

    await UpdatePost.prototype.update(req, res);
    expect(PostCache.prototype.updatePostInCache).toHaveBeenCalledWith(req.params.postId, updatedPost);
    expect(postServer.socketIOPostObject.emit).toHaveBeenCalledWith('update post', postMockData, 'posts');
    expect(postQueue.addPostJob).toHaveBeenCalledWith('updatePostInDB', { key: req.params.postId, value: postMockData });

    expect(res.status).toHaveBeenCalledWith(200);
    expect(res.json).toHaveBeenCalledWith({ message: 'Update post successfully' });
  });
});

describe('UpdatePost with image', () => {
  beforeEach(() => {
    jest.resetAllMocks();
  });
  afterEach(() => {
    jest.clearAllMocks();
    jest.clearAllTimers();
  });

  it('Update post without touching image', async () => {
    updatedPost.imgId = '1234';
    updatedPost.imgVersion = '1234';

    const req: Request = postMockRequest(updatedPost, authUserPayload, { postId: postMockData._id?.toString() }) as Request;
    const res: Response = postMockResponse();

    jest.spyOn(postQueue, 'addPostJob');
    jest.spyOn(PostCache.prototype, 'updatePostInCache').mockResolvedValue(postMockData);
    jest.spyOn(postServer.socketIOPostObject, 'emit');

    await UpdatePost.prototype.postWithImage(req, res);
    expect(PostCache.prototype.updatePostInCache).toHaveBeenCalledWith(req.params.postId, updatedPost);
    expect(postServer.socketIOPostObject.emit).toHaveBeenCalledWith('update post', postMockData, 'posts');
    expect(postQueue.addPostJob).toHaveBeenCalledWith('updatePostInDB', { key: req.params.postId, value: postMockData });

    expect(res.status).toHaveBeenCalledWith(200);
    expect(res.json).toHaveBeenCalledWith({ message: 'Post with image updated successfully' });
  });

  it('Update post with image, should throw error uploading image from cloudinary ', async () => {
    updatedPostWithImage.image =
      'data:image/jpeg;base64,';

    const req: Request = postMockRequest(updatedPostWithImage, authUserPayload, { postId: postMockData._id?.toString() }) as Request;
    const res: Response = postMockResponse();

    jest.spyOn(postQueue, 'addPostJob');
    jest.spyOn(PostCache.prototype, 'updatePostInCache').mockResolvedValue(postMockData);
    jest.spyOn(postServer.socketIOPostObject, 'emit');
    jest.spyOn(cloudinaryUploads, 'uploads').mockResolvedValue({ message: 'Upload fail' } as unknown as UploadApiResponse);

    await UpdatePost.prototype.postWithImage(req, res).catch((error: CustomError) => {
      expect(error.serializeErrors().message).toBe('Upload fail');
      expect(error.statusCode).toBe(HTTP_STATUS.BAD_REQUEST);
      expect(cloudinaryUploads.uploads).toHaveBeenCalledWith(updatedPostWithImage.image);
    });

    // expect(PostCache.prototype.updatePostInCache).toHaveBeenCalledWith(req.params.postId, updatedPostWithImage);
    // expect(postServer.socketIOPostObject.emit).toHaveBeenCalledWith('update post', postMockData, 'posts');
    // expect(postQueue.addPostJob).toHaveBeenCalledWith('updatePostInDB', { key: req.params.postId, value: postMockData });
  });

  it('Update post with image, should send correct json', async () => {
    updatedPostWithImage.image =
      'data:image/jpeg;base64,';

    const req: Request = postMockRequest(updatedPostWithImage, authUserPayload, { postId: postMockData._id?.toString() }) as Request;
    const res: Response = postMockResponse();

    jest.spyOn(postQueue, 'addPostJob');
    jest.spyOn(PostCache.prototype, 'updatePostInCache').mockResolvedValue(postMockData);
    jest.spyOn(postServer.socketIOPostObject, 'emit');
    jest.spyOn(cloudinaryUploads, 'uploads').mockResolvedValue({ version: '1234', public_id: '1234' } as unknown as UploadApiResponse);

    await UpdatePost.prototype.postWithImage(req, res);

    updatedPostWithImage.imgVersion = '1234';
    updatedPostWithImage.imgId = '1234';

    expect(PostCache.prototype.updatePostInCache).toHaveBeenCalledWith(req.params.postId, updatedPostWithImage);
    expect(postServer.socketIOPostObject.emit).toHaveBeenCalledWith('update post', postMockData, 'posts');
    expect(postQueue.addPostJob).toHaveBeenCalledWith('updatePostInDB', { key: req.params.postId, value: postMockData });
  });
});
